import React from "react";
import "../MainProject/Mainproject.scss";
import Logo from "../../../Images/Tams-Tech.JPG"
import Belka from "../../../Images/belkanigeria.JPG"


export default function Mainproject() {
    const mappedProject = [
        {id : 0, projectPic: `${Logo}`, projectName: "Tams-Technology",  projectStatus: "Incomplete", projectDate: "2022"},
        {id : 1, projectPic: `${Belka}`, projectName: "Belka Nigeria", projectStatus: "Incomplete", projectDate: "2022"}
      ]

  return (
    <div className="row">
        {mappedProject.map((project)=>
        <div className="col-md-4" key={project.id}>
        <div className="card project_card">
          <img src={project.projectPic} className="card-img-top" alt="..." />
          <div className="card-body">
            <span className="card-text">
             {project.projectName}
            </span><br />
            <span>{project.projectStatus}</span>
          </div>
        </div>
      </div>
        )}
    </div>
  );
}
